import cloudinary from 'cloudinary';

// handler create image
const CreateImage = async image => {
    this.data = false;
    const addImage = await cloudinary.v2.uploader.upload(image);
    if(addImage){
        this.data = addImage;
    }else{
        console.error(addImage)
    }
    return this.data;
}

export default CreateImage;
